import{_ as e,c as o,o as t,b as a}from"./app.c48ca7df.js";const b='{"title":"\u041D\u0430\u0443\u0447\u043D\u044B\u0435 \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u0438\u044F","description":"","frontmatter":{"title":"\u041D\u0430\u0443\u0447\u043D\u044B\u0435 \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u0438\u044F","subtitle":"\u0427\u0442\u043E \u0442\u0430\u043A\u043E\u0435 \u0434\u0438\u0441\u043A\u0443\u0440\u0441 \u0441 \u0442\u043E\u0447\u043A\u0438 \u0437\u0440\u0435\u043D\u0438\u044F \u043D\u0430\u0443\u043A\u0438","date":"2022-02-28T00:00:00.000Z","cover":"books.jpg","taxonomy":{"category":["\u0414\u0438\u0441\u043A\u0443\u0440\u0441"]},"tags":"discourse"},"headers":[],"relativePath":"discource/definitions/index.md"}',c={},r=a('<blockquote><p>\xAB\u0414\u0438\u0441\u043A\u0443\u0440\u0441 \u0435\u0441\u0442\u044C \u0440\u0435\u0447\u0435\u0432\u043E\u0439 \u043F\u0440\u043E\u0434\u0443\u043A\u0442, \u0440\u0430\u0441\u0441\u043C\u0430\u0442\u0440\u0438\u0432\u0430\u0435\u043C\u044B\u0439 \u043A\u0430\u043A \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435, \u043E\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043B\u044F\u0435\u043C\u043E\u0435 \u0441 \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u043D\u044B\u043C\u0438 \u0438\u043D\u0442\u0435\u043D\u0446\u0438\u044F\u043C\u0438, \u0445\u0430\u0440\u0430\u043A\u0442\u0435\u0440\u0438\u0437\u0443\u044E\u0449\u0435\u0435\u0441\u044F \u0442\u0438\u043F\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438 \u043E\u0431\u0443\u0441\u043B\u043E\u0432\u043B\u0435\u043D\u043D\u044B\u043C \u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u0442\u0438\u0432\u043D\u044B\u043C \u043F\u0440\u043E\u0441\u0442\u0440\u0430\u043D\u0441\u0442\u0432\u043E\u043C\xBB [\u0418.\u0412. \u041A\u0430\u0440\u0430\u0441\u0438\u043A 2000, 17]</p></blockquote><hr><blockquote><p>\xAB\u041A\u0430\u043A\u0438\u043C\u0438 \u0431\u044B \u043D\u0438 \u0431\u044B\u043B\u0438 \u0440\u0430\u0437\u043B\u0438\u0447\u0438\u044F \u0432 \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u0438\u0438 \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430, \u043C\u043D\u0435\u043D\u0438\u044F \u0443\u0447\u0435\u043D\u044B\u0445-\u043B\u0438\u043D\u0433\u0432\u0438\u0441\u0442\u043E\u0432 \u0441\u0445\u043E\u0434\u044F\u0442\u0441\u044F \u0432 \u043E\u0434\u043D\u043E\u043C: \u0434\u0438\u0441\u043A\u0443\u0440\u0441 \u2014 \u044D\u0442\u043E \u0438\u0435\u0440\u0430\u0440\u0445\u0438\u0437\u0438\u0440\u043E\u0432\u0430\u043D\u043D\u043E\u0435 \u0440\u0435\u0447\u0435\u0432\u043E\u0435 \u043E\u0431\u0449\u0435\u043D\u0438\u0435, \u0441\u043E\u043F\u0440\u043E\u0432\u043E\u0436\u0434\u0430\u044E\u0449\u0435\u0435 \u043F\u0440\u043E\u0446\u0435\u0441\u0441 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E \u0437\u043D\u0430\u0447\u0438\u043C\u043E\u0433\u043E \u0432\u0437\u0430\u0438\u043C\u043E\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F \u043B\u044E\u0434\u0435\u0439, \u0440\u0430\u0441\u0441\u043C\u0430\u0442\u0440\u0438\u0432\u0430\u0435\u043C\u043E\u0435 \u0441 \u043F\u043E\u0437\u0438\u0446\u0438\u0439 \u0438\u0445 \u043F\u0440\u0438\u043D\u0430\u0434\u043B\u0435\u0436\u043D\u043E\u0441\u0442\u0438 \u043A \u0442\u043E\u0439 \u0438\u043B\u0438 \u0438\u043D\u043E\u0439 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0439 \u0433\u0440\u0443\u043F\u043F\u0435 \u0438\u043B\u0438 \u043F\u0440\u0438\u043C\u0435\u043D\u0438\u0442\u0435\u043B\u044C\u043D\u043E \u043A \u0442\u043E\u0439 \u0438\u043B\u0438 \u0438\u043D\u043E\u0439 \u0442\u0438\u043F\u0438\u0447\u043D\u043E\u0439 \u0440\u0435\u0447\u0435\u043F\u043E\u0432\u0435\u0434\u0435\u043D\u0447\u0435\u0441\u043A\u043E\u0439 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438. \u0421\u043B\u0435\u0434\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u043D\u043E, \u0434\u0438\u0441\u043A\u0443\u0440\u0441 \u2014 \u044D\u0442\u043E \u043E\u0434\u043D\u043E\u0432\u0440\u0435\u043C\u0435\u043D\u043D\u043E \u0438 \u043F\u0440\u043E\u0446\u0435\u0441\u0441 \u044F\u0437\u044B\u043A\u043E\u0432\u043E\u0439 \u0434\u0435\u044F\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u0438, \u0438 \u0435\u0451 \u0440\u0435\u0437\u0443\u043B\u044C\u0442\u0430\u0442.\xBB</p></blockquote><hr><blockquote><p>\u0412.\u0417. \u0414\u0435\u043C\u044C\u044F\u043D\u043A\u043E\u0432 \u0432 \u0441\u043B\u043E\u0432\u0430\u0440\u0435 \u2018\u0410\u043D\u0433\u043B\u043E-\u0440\u0443\u0441\u0441\u043A\u0438\u0445 \u0442\u0435\u0440\u043C\u0438\u043D\u043E\u0432 \u043F\u043E \u043F\u0440\u0438\u043A\u043B\u0430\u0434\u043D\u043E\u0439 \u043B\u0438\u043D\u0433\u0432\u0438\u0441\u0442\u0438\u043A\u0435 \u0438 \u0430\u0432\u0442\u043E\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0439 \u043F\u0435\u0440\u0435\u0440\u0430\u0431\u043E\u0442\u043A\u0435 \u0442\u0435\u043A\u0441\u0442\u0430\u2019 \u0434\u0430\u043B \u043E\u0431\u043E\u0431\u0449\u0430\u044E\u0449\u0435\u0435 \u043E\u043F\u0438\u0441\u0430\u043D\u0438\u0435 \u0442\u043E\u0433\u043E, \u0447\u0442\u043E \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043B\u044F\u0435\u0442 \u0441\u043E\u0431\u043E\u0439 \u2018\u0433\u0440\u0430\u043C\u043C\u0430\u0442\u0438\u043A\u0430\u2019 \u0438, \u0448\u0438\u0440\u0435, \u2018\u043C\u0438\u0440 \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430\u2019. \u0412.\u0417. \u0414\u0435\u043C\u044C\u044F\u043D\u043A\u043E\u0432 \u043F\u0438\u0441\u0430\u043B: \xABDiscourse \u2013 \u0434\u0438\u0441\u043A\u0443\u0440\u0441, \u043F\u0440\u043E\u0438\u0437\u0432\u043E\u043B\u044C\u043D\u044B\u0439 \u0444\u0440\u0430\u0433\u043C\u0435\u043D\u0442 \u0442\u0435\u043A\u0441\u0442\u0430, \u0441\u043E\u0441\u0442\u043E\u044F\u0449\u0438\u0439 \u0431\u043E\u043B\u0435\u0435 \u0447\u0435\u043C \u0438\u0437 \u043E\u0434\u043D\u043E\u0433\u043E \u043F\u0440\u0435\u0434\u043B\u043E\u0436\u0435\u043D\u0438\u044F \u0438\u043B\u0438 \u043D\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043C\u043E\u0439 \u0447\u0430\u0441\u0442\u0438 \u043F\u0440\u0435\u0434\u043B\u043E\u0436\u0435\u043D\u0438\u044F. \u0427\u0430\u0441\u0442\u043E, \u043D\u043E \u043D\u0435 \u0432\u0441\u0435\u0433\u0434\u0430, \u043A\u043E\u043D\u0446\u0435\u043D\u0442\u0440\u0438\u0440\u0443\u0435\u0442\u0441\u044F \u0432\u043E\u043A\u0440\u0443\u0433 \u043D\u0435\u043A\u043E\u0442\u043E\u0440\u043E\u0433\u043E \u043E\u043F\u043E\u0440\u043D\u043E\u0433\u043E \u043A\u043E\u043D\u0446\u0435\u043F\u0442\u0430; \u0441\u043E\u0437\u0434\u0430\u0435\u0442 \u043E\u0431\u0449\u0438\u0439 \u043A\u043E\u043D\u0442\u0435\u043A\u0441\u0442, \u043E\u043F\u0438\u0441\u044B\u0432\u0430\u044E\u0449\u0438\u0439 \u0434\u0435\u0439\u0441\u0442\u0432\u0443\u044E\u0449\u0438\u0435 \u043B\u0438\u0446\u0430, \u043E\u0431\u044A\u0435\u043A\u0442\u044B, \u043E\u0431\u0441\u0442\u043E\u044F\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0430, \u0432\u0440\u0435\u043C\u0435\u043D\u0430, \u043F\u043E\u0441\u0442\u0443\u043F\u043A\u0438 \u0438 \u0442. \u043F., \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u044F\u044F\u0441\u044C \u043D\u0435 \u0441\u0442\u043E\u043B\u044C\u043A\u043E \u043F\u043E\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u044C\u044E \u043F\u0440\u0435\u0434\u043B\u043E\u0436\u0435\u043D\u0438\u0439, \u0441\u043A\u043E\u043B\u044C\u043A\u043E \u0442\u0435\u043C \u043E\u0431\u0449\u0438\u043C \u0434\u043B\u044F \u0441\u043E\u0437\u0434\u0430\u044E\u0449\u0435\u0433\u043E \u0434\u0438\u0441\u043A\u0443\u0440\u0441 \u0438 \u0435\u0433\u043E \u0438\u043D\u0442\u0435\u0440\u043F\u0440\u0435\u0442\u0430\u0442\u043E\u0440\u0430 \u043C\u0438\u0440\u043E\u043C, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u2018\u0441\u0442\u0440\u043E\u0438\u0442\u0441\u044F\u2019 \u043F\u043E \u0445\u043E\u0434\u0443 \u0440\u0430\u0437\u0432\u0435\u0440\u0442\u044B\u0432\u0430\u043D\u0438\u044F \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430. \u0418\u0441\u0445\u043E\u0434\u043D\u0430\u044F \u0441\u0442\u0440\u0443\u043A\u0442\u0443\u0440\u0430 \u0434\u043B\u044F \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430 \u0438\u043C\u0435\u0435\u0442 \u0432\u0438\u0434 \u043F\u043E\u0441\u043B\u0435\u0434\u043E\u0432\u0430\u0442\u0435\u043B\u044C\u043D\u043E\u0441\u0442\u0438 \u044D\u043B\u0435\u043C\u0435\u043D\u0442\u0430\u0440\u043D\u044B\u0445 \u043F\u0440\u043E\u043F\u043E\u0437\u0438\u0446\u0438\u0439, \u0441\u0432\u044F\u0437\u0430\u043D\u043D\u044B\u0445 \u043C\u0435\u0436\u0434\u0443 \u0441\u043E\u0431\u043E\u0439 \u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u043C\u0438 \u043E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u044F\u043C\u0438 \u043A\u043E\u043D\u044A\u044E\u043D\u043A\u0446\u0438\u0438, \u0434\u0438\u0437\u044A\u044E\u043D\u043A\u0446\u0438\u0438 \u0438 \u0442. \u043F. \u042D\u043B\u0435\u043C\u0435\u043D\u0442\u044B \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430: \u0438\u0437\u043B\u0430\u0433\u0430\u0435\u043C\u044B\u0435 \u0441\u043E\u0431\u044B\u0442\u0438\u044F, \u0438\u0445 \u0443\u0447\u0430\u0441\u0442\u043D\u0438\u043A\u0438, \u043F\u0435\u0440\u0444\u043E\u0440\u043C\u0430\u0442\u0438\u0432\u043D\u0430\u044F \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u044F \u0438 \u2018\u043D\u0435-\u0441\u043E\u0431\u044B\u0442\u0438\u044F\u2019, \u0442. \u0435. \u0430) \u043E\u0431\u0441\u0442\u043E\u044F\u0442\u0435\u043B\u044C\u0441\u0442\u0432\u0430, \u0441\u043E\u043F\u0440\u043E\u0432\u043E\u0436\u0434\u0430\u044E\u0449\u0438\u0435 \u0441\u043E\u0431\u044B\u0442\u0438\u044F; \u0431) \u0444\u043E\u043D, \u043F\u043E\u044F\u0441\u043D\u044F\u044E\u0449\u0438\u0439 \u0441\u043E\u0431\u044B\u0442\u0438\u044F; \u0432) \u043E\u0446\u0435\u043D\u043A\u0430 \u0443\u0447\u0430\u0441\u0442\u043D\u0438\u043A\u043E\u0432 \u0441\u043E\u0431\u044B\u0442\u0438\u0439; \u0433) \u0438\u043D\u0444\u043E\u0440\u043C\u0430\u0446\u0438\u044F, \u0441\u043E\u043E\u0442\u043D\u043E\u0441\u044F\u0449\u0430\u044F \u0434\u0438\u0441\u043A\u0443\u0440\u0441 \u0441 \u0441\u043E\u0431\u044B\u0442\u0438\u044F\u043C\u0438\xBB.</p></blockquote><hr><blockquote><p>\u0412 \u0442\u0440\u0435\u0442\u044C\u0435\u0439 \u0442\u0440\u0430\u043A\u0442\u043E\u0432\u043A\u0435 \u0434\u0438\u0441\u043A\u0443\u0440\u0441 \u0440\u0430\u0441\u0441\u043C\u0430\u0442\u0440\u0438\u0432\u0430\u0435\u0442\u0441\u044F \u043A\u0430\u043A \u0441\u043B\u043E\u0436\u043D\u043E\u0435 \u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u0442\u0438\u0432\u043D\u043E\u0435 \u044F\u0432\u043B\u0435\u043D\u0438\u0435, \u043E\u0442\u0440\u0430\u0436\u0430\u044E\u0449\u0435\u0435 \u0434\u0438\u043D\u0430\u043C\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u043F\u0440\u043E\u0446\u0435\u0441\u0441 \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u043E\u0432\u0430\u043D\u0438\u044F \u044F\u0437\u044B\u043A\u0430 \u0432 \u043A\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u0438\u043D\u0441\u0442\u0440\u0443\u043C\u0435\u043D\u0442\u0430 \u043E\u0431\u0449\u0435\u043D\u0438\u044F, \u0441 \u043F\u043E\u043C\u043E\u0449\u044C\u044E \u043A\u043E\u0442\u043E\u0440\u043E\u0433\u043E \u0441\u0443\u0431\u044A\u0435\u043A\u0442\u044B \u0440\u0435\u0447\u0435\u0432\u043E\u0433\u043E \u0432\u0437\u0430\u0438\u043C\u043E\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F \u0432 \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u043D\u043E\u0439 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438 \u0438\u043C\u043F\u043B\u0438\u0446\u0438\u0442\u043D\u043E \u0438\u043B\u0438 \u044D\u043A\u0441\u043F\u043B\u0438\u0446\u0438\u0442\u043D\u043E \u0432\u044B\u0440\u0430\u0436\u0430\u044E\u0442 \u0441\u0432\u043E\u0438 \u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u0442\u0438\u0432\u043D\u044B\u0435 \u043D\u0430\u043C\u0435\u0440\u0435\u043D\u0438\u044F (\u041D. \u0412. \u0415\u043B\u0443\u0445\u0438\u043D\u0430, \u041E. \u0412. \u041A\u043E\u0440\u043E\u0442\u0435\u0435\u0432\u0430, \u0415. \u0421. \u041A\u0443\u0431\u0440\u044F\u043A\u043E\u0432\u0430, \u0410. \u041A. \u041C\u0438\u0445\u0430\u043B\u044C\u0441\u043A\u0430\u044F). \u0412 \u0440\u0430\u043C\u043A\u0430\u0445 \u0434\u0430\u043D\u043D\u043E\u0433\u043E \u043F\u043E\u0434\u0445\u043E\u0434\u0430 \u0446\u0435\u043D\u0442\u0440 \u0442\u044F\u0436\u0435\u0441\u0442\u0438 \u043F\u0435\u0440\u0435\u043D\u043E\u0441\u0438\u0442\u0441\u044F \u0441 \u0447\u0438\u0441\u0442\u043E \u043B\u0438\u043D\u0433\u0432\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u0430\u043D\u0430\u043B\u0438\u0437\u0430 \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430 \u043D\u0430 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0435 \u0444\u0430\u043A\u0442\u043E\u0440\u044B \u043E\u0431\u0449\u0435\u043D\u0438\u044F: \xAB\u0414\u0438\u0441\u043A\u0443\u0440\u0441 \u043D\u0430\u0447\u0438\u043D\u0430\u0435\u0442 \u043F\u043E\u043D\u0438\u043C\u0430\u0442\u044C\u0441\u044F \u043A\u0430\u043A \u0441\u043B\u043E\u0436\u043D\u043E\u0435 \u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u0442\u0438\u0432\u043D\u043E\u0435 \u044F\u0432\u043B\u0435\u043D\u0438\u0435, \u043D\u0435 \u0442\u043E\u043B\u044C\u043A\u043E \u0432\u043A\u043B\u044E\u0447\u0430\u044E\u0449\u0435\u0435 \u0430\u043A\u0442 \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u044F \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u043D\u043E\u0433\u043E \u0442\u0435\u043A\u0441\u0442\u0430, \u043D\u043E \u0438 \u043E\u0442\u0440\u0430\u0436\u0430\u044E\u0449\u0435\u0435 \u0437\u0430\u0432\u0438\u0441\u0438\u043C\u043E\u0441\u0442\u044C \u0441\u043E\u0437\u0434\u0430\u0432\u0430\u0435\u043C\u043E\u0433\u043E \u0440\u0435\u0447\u0435\u0432\u043E\u0433\u043E \u043F\u0440\u043E\u0438\u0437\u0432\u0435\u0434\u0435\u043D\u0438\u044F \u043E\u0442 \u0437\u043D\u0430\u0447\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u0433\u043E \u043A\u043E\u043B\u0438\u0447\u0435\u0441\u0442\u0432\u0430 \u044D\u043A\u0441\u0442\u0440\u0430\u043B\u0438\u043D\u0433\u0432\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0445 \u043E\u0431\u0441\u0442\u043E\u044F\u0442\u0435\u043B\u044C\u0441\u0442\u0432 \u2014 \u0437\u043D\u0430\u043D\u0438\u0439 \u043E \u043C\u0438\u0440\u0435, \u043C\u043D\u0435\u043D\u0438\u0439 \u0438 \u043A\u043E\u043D\u043A\u0440\u0435\u0442\u043D\u044B\u0445 \u0446\u0435\u043B\u0435\u0439 \u0433\u043E\u0432\u043E\u0440\u044F\u0449\u0435\u0433\u043E \u043A\u0430\u043A \u0441\u043E\u0437\u0434\u0430\u0442\u0435\u043B\u044F \u0442\u0435\u043A\u0441\u0442\u0430\xBB (6, \u0441. 18). \u0422\u0430\u043A\u0430\u044F \u0442\u0440\u0430\u043A\u0442\u043E\u0432\u043A\u0430 \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430 \u0441\u043E\u0437\u0432\u0443\u0447\u043D\u0430 \u043D\u0430\u0443\u0447\u043D\u044B\u043C \u0432\u0437\u0433\u043B\u044F\u0434\u0430\u043C \u041D. \u0412. \u0415\u043B\u0443\u0445\u0438\u043D\u043E\u0439, \u043A\u043E\u0442\u043E\u0440\u0430\u044F \u0440\u0430\u0441\u0441\u043C\u0430\u0442\u0440\u0438\u0432\u0430\u0435\u0442 \u0434\u0438\u0441\u043A\u0443\u0440\u0441 \u043A\u0430\u043A \xAB\u043E\u0431\u0440\u0430\u0437\u0435\u0446 \u0440\u0435\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u0438 \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u043D\u044B\u0445 \u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u0442\u0438\u0432\u043D\u044B\u0445 \u043D\u0430\u043C\u0435\u0440\u0435\u043D\u0438\u0439 \u0432 \u043A\u043E\u043D\u0442\u0435\u043A\u0441\u0442\u0435 \u043A\u043E\u043D\u043A\u0440\u0435\u0442\u043D\u043E\u0439 \u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u0442\u0438\u0432\u043D\u043E\u0439 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438 \u0438 \u043F\u043E \u043E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u044E \u043A \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u043D\u043E\u043C\u0443 \u043F\u0430\u0440\u0442\u043D\u0435\u0440\u0443, \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043B\u044E \u0438\u043D\u043E\u0439 \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u044B, \u0432\u044B\u0440\u0430\u0436\u0435\u043D\u043D\u043E\u0439 \u0443\u043C\u0435\u0441\u0442\u043D\u044B\u043C\u0438 \u0432 \u0434\u0430\u043D\u043D\u043E\u0439 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438 \u044F\u0437\u044B- \u043A\u043E\u0432\u044B\u043C\u0438 \u0438 \u043D\u0435\u044F\u0437\u044B\u043A\u043E\u0432\u044B\u043C\u0438 \u0441\u0440\u0435\u0434\u0441\u0442\u0432\u0430\u043C\u0438. \u041F\u0440\u0438 \u044D\u0442\u043E\u043C \u0430\u0434\u0435\u043A\u0432\u0430\u0442\u043D\u043E\u0441\u0442\u044C \u0440\u0435\u0447\u0435\u0432\u043E\u0433\u043E \u043F\u043E\u0432\u0435\u0434\u0435\u043D\u0438\u044F \u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u043D\u0442\u043E\u0432 \u043E\u0446\u0435\u043D\u0438\u0432\u0430\u0435\u0442\u0441\u044F \u0443\u0441\u043F\u0435\u0445\u043E\u043C \u0440\u0435\u0447\u0435\u0432\u043E\u0433\u043E \u0432\u0437\u0430\u0438\u043C\u043E\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F, \u0442.\u0435. \u0434\u043E\u0441\u0442\u0438\u0436\u0435\u043D\u0438\u0435\u043C \u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u0442\u0438\u0432\u043D\u043E\u0439 \u0446\u0435\u043B\u0438, \u0430 \u0442\u0430\u043A\u0436\u0435 \u0441\u043E\u043E\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0435\u043C \u043F\u0440\u0430\u0432\u0438\u043B\u0430\u043C \u0440\u0435\u0447\u0435\u0432\u043E\u0433\u043E \u0438 \u043D\u0435\u0440\u0435\u0447\u0435\u0432\u043E\u0433\u043E \u043F\u043E\u0432\u0435\u0434\u0435\u043D\u0438\u044F \u0432 \u0434\u0430\u043D\u043D\u043E\u043C \u043A\u0443\u043B\u044C\u0442\u0443\u0440\u043D\u043E\u043C \u0441\u043E\u043E\u0431\u0449\u0435\u0441\u0442\u0432\u0435\xBB (4, \u0441. 9\u201410). \u0418\u0437 \u044D\u0442\u043E\u0433\u043E \u0441\u043B\u0435\u0434\u0443\u0435\u0442, \u0447\u0442\u043E \u043D\u0435\u043E\u0431\u0445\u043E\u0434\u0438\u043C\u044B\u043C\u0438 \u0443\u0441\u043B\u043E\u0432\u0438\u044F\u043C\u0438 \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430 \u044F\u0432\u043B\u044F\u044E\u0442\u0441\u044F \u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u0442\u0438\u0432\u043D\u044B\u0439 \u043A\u043E\u043D\u0442\u0435\u043A\u0441\u0442 \u0438 \u0443\u0441\u043B\u043E\u0432\u0438\u044F \u043E\u0431\u0449\u0435\u043D\u0438\u044F. &quot;</p></blockquote><hr><blockquote><p>\u041F\u043E\u0434 \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u043E\u043C \u043F\u043E\u043D\u0438\u043C\u0430\u044E\u0442 \u043E\u0441\u043E\u0431\u044B\u0439 \u0438\u0434\u0435\u0430\u043B\u044C\u043D\u044B\u0439 \u0432\u0438\u0434 \u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u0446\u0438\u0438, \u043E\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043B\u044F\u0435\u043C\u044B\u0439 \u0432 \u043C\u0430\u043A\u0441\u0438\u043C\u0430\u043B\u044C\u043D\u043E \u0432\u043E\u0437\u043C\u043E\u0436\u043D\u043E\u043C \u043E\u0442\u0441\u0442\u0440\u0430\u043D\u0435\u043D\u0438\u0438 \u043E\u0442 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0439 \u0440\u0435\u0430\u043B\u044C\u043D\u043E\u0441\u0442\u0438, \u0442\u0440\u0430\u0434\u0438\u0446\u0438\u0439, \u0430\u0432\u0442\u043E\u0440\u0438\u0442\u0435\u0442\u0430, \u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u0442\u0438\u0432\u043D\u043E\u0439 \u0440\u0443\u0442\u0438\u043D\u044B \u0438 \u0442. \u043F. \u0438 \u0438\u043C\u0435\u044E\u0449\u0438\u0439 \u0446\u0435\u043B\u044C\u044E \u043A\u0440\u0438\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u043E\u0431\u0441\u0443\u0436\u0434\u0435\u043D\u0438\u0435 \u0438 \u043E\u0431\u043E\u0441\u043D\u043E\u0432\u0430\u043D\u0438\u0435 \u0432\u0437\u0433\u043B\u044F\u0434\u043E\u0432 \u0438 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u0443\u0447\u0430\u0441\u0442\u043D\u0438\u043A\u043E\u0432 \u043A\u043E\u043C\u043C\u0443\u043D\u0438\u043A\u0430\u0446\u0438\u0438 \u0438\u043B\u0438 \xAB\u0434\u0438\u0441\u043A\u0443\u0440\u0441 \u0440\u0430\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u0441\u0442\u0438\xBB. \u0422\u0430\u043A\u043E\u0435 \u043F\u043E\u043D\u0438\u043C\u0430\u043D\u0438\u0435 \u0441\u0432\u044F\u0437\u0430\u043D\u043E \u0441 \u0438\u043C\u0435\u043D\u0435\u043C \u043D\u0435\u043C\u0435\u0446\u043A\u043E\u0433\u043E \u0444\u0438\u043B\u043E\u0441\u043E\u0444\u0430 \u0438 \u0441\u043E\u0446\u0438\u043E\u043B\u043E\u0433\u0430 \u042E. \u0425\u0430\u0431\u0435\u0440\u043C\u0430\u0441\u0430</p></blockquote><hr><blockquote><p>\u0414\u0438\u0441\u043A\u0443\u0440\u0441 - \u0441\u0432\u044F\u0437\u043D\u044B\u0439 \u0442\u0435\u043A\u0441\u0442 \u0432 \u0441\u043E\u0432\u043E\u043A\u0443\u043F\u043D\u043E\u0441\u0442\u0438 \u0441 \u044D\u043A\u0441\u0442\u0440\u0430\u043B\u0438\u043D\u0433\u0432\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u043C\u0438: \u043F\u0440\u0430\u0433\u043C\u0430\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u043C\u0438, \u0441\u043E\u0446\u0438\u043E\u043A\u0443\u043B\u044C\u0442\u0443\u0440\u043D\u044B\u043C\u0438, \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u0438\u043C\u0438 \u0438 \u0434\u0440\u0443\u0433\u0438\u043C\u0438 \u0444\u0430\u043A\u0442\u043E\u0440\u0430\u043C\u0438; \u0440\u0435\u0447\u044C, \u0440\u0430\u0441\u0441\u043C\u0430\u0442\u0440\u0438\u0432\u0430\u0435\u043C\u0430\u044F \u043A\u0430\u043A \u0446\u0435\u043B\u0435\u043D\u0430\u043F\u0440\u0430\u0432\u043B\u0435\u043D\u043D\u043E\u0435 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u043E\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0435, \u043A\u0430\u043A \u043A\u043E\u043C\u043F\u043E\u043D\u0435\u043D\u0442, \u0443\u0447\u0430\u0441\u0442\u0432\u0443\u044E\u0449\u0438\u0439 \u0432\u043E \u0432\u0437\u0430\u0438\u043C\u043E\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0438 \u043B\u044E\u0434\u0435\u0439 \u0438 \u043C\u0435\u0445\u0430\u043D\u0438\u0437\u043C\u0430\u0445 \u0438\u0445 \u0441\u043E\u0437\u043D\u0430\u043D\u0438\u044F (\u043A\u043E\u0433\u043D\u0438\u0442\u0438\u0432\u043D\u044B\u0445 \u043F\u0440\u043E\u0446\u0435\u0441\u0441\u0430\u0445) (\u041B\u0438\u043D\u0433\u0432\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u044D\u043D\u0446\u0438\u043A\u043B\u043E\u043F\u0435\u0434\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u0441\u043B\u043E\u0432\u0430\u0440\u044C).</p></blockquote><h1 id="\u0441\u043E\u0446\u0438\u043En\u0438\u043D\u0433\u0432\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0439-\u0430\u043D\u0430n\u0438\u0437-\u0438\u043D\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u043E\u043D\u0430n\u044C\u043D\u043E\u0433\u043E-\u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430" tabindex="-1">\u0421\u043E\u0446\u0438\u043E\u043B\u0438\u043D\u0433\u0432\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u0430\u043D\u0430\u043B\u0438\u0437 \u0438\u043D\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430 <a class="header-anchor" href="#\u0441\u043E\u0446\u0438\u043En\u0438\u043D\u0433\u0432\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0439-\u0430\u043D\u0430n\u0438\u0437-\u0438\u043D\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u043E\u043D\u0430n\u044C\u043D\u043E\u0433\u043E-\u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430" aria-hidden="true">#</a></h1><p>\u041F\u0440\u0438 \u0441\u043E\u0446\u0438\u043E\u043B\u0438\u043D\u0433\u0432\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u043E\u043C \u0430\u043D\u0430\u043B\u0438\u0437\u0435 \u0438\u043D\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430 \u0430\u043D\u0430\u043B\u0438\u0437\u0438\u0440\u0443\u044E\u0442\u0441\u044F \u0441\u043B\u0435\u0434\u0443\u044E\u0449\u0438\u0435 \u043F\u0440\u0438\u0437\u043D\u0430\u043A\u0438 \u044D\u0442\u043E\u0433\u043E \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430: 1) \u0446\u0435\u043B\u044C; 2) \u0443\u0447\u0430\u0441\u0442\u043D\u0438\u043A\u0438; 3) \u0445\u0440\u043E\u043D\u043E\u0442\u043E\u043F; 4) \u0446\u0435\u043D\u043D\u043E\u0441\u0442\u0438; 5) \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0438\u0438; 6) \u0436\u0430\u043D\u0440\u044B. \u042D\u0442\u043E \u0441\u0438\u0441\u0442\u0435\u043C\u0430\u043E\u0431\u0440\u0430\u0437\u0443\u044E\u0449\u0438\u0435 \u043F\u0440\u0438\u0437\u043D\u0430\u043A\u0438 \u044D\u0442\u043E\u0433\u043E \u0442\u0438\u043F\u0430 \u0434\u0438\u0441\u043A\u0443\u0440\u0441\u0430.</p><h4 id="\u0433n\u0430\u0432\u043D\u044B\u0435-\u0442\u0438\u043F\u044B-\u0440\u0435\u0447\u0435\u0432\u044B\u0445-\u0430\u043A\u0442\u043E\u0432" tabindex="-1">\u0413\u043B\u0430\u0432\u043D\u044B\u0435 \u0442\u0438\u043F\u044B \u0440\u0435\u0447\u0435\u0432\u044B\u0445 \u0430\u043A\u0442\u043E\u0432 <a class="header-anchor" href="#\u0433n\u0430\u0432\u043D\u044B\u0435-\u0442\u0438\u043F\u044B-\u0440\u0435\u0447\u0435\u0432\u044B\u0445-\u0430\u043A\u0442\u043E\u0432" aria-hidden="true">#</a></h4><p>\u0422\u0440\u0430\u0434\u0438\u0446\u0438\u043E\u043D\u043D\u043E \u0432\u044B\u0434\u0435\u043B\u044F\u044E\u0442 \u043F\u044F\u0442\u044C \u0433\u043B\u0430\u0432\u043D\u044B\u0445 \u0442\u0438\u043F\u043E\u0432 \u0440\u0435\u0447\u0435\u0432\u044B\u0445 \u0430\u043A\u0442\u043E\u0432: 1) \u0440\u0435\u043F\u0440\u0435\u0437\u0435\u043D\u0442\u0430\u0442\u0438\u0432\u044B, \u0446\u0435\u043B\u044C\u044E \u043A\u043E\u0442\u043E\u0440\u044B\u0445 \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0441\u0443\u0436\u0434\u0435\u043D\u0438\u0435 \u043E\u0431 \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u043D\u043E\u043C \u0441\u043E\u0441\u0442\u043E\u044F\u043D\u0438\u0438 \u0432\u0435\u0449\u0435\u0439; 2) \u0434\u0438\u0440\u0435\u043A\u0442\u0438\u0432\u044B \u2014 \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0435 \u0434\u0430\u0432\u043B\u0435\u043D\u0438\u044F \u043D\u0430 \u0430\u0434\u0440\u0435\u0441\u0430\u0442\u0430, \u0441\u043A\u043B\u043E\u043D\u0435\u043D\u0438\u0435 \u0435\u0433\u043E \u043A \u043E\u043F\u0440\u0435\u0434\u0435\u043B\u0435\u043D\u043D\u044B\u043C \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044F\u043C; 3) \u043A\u043E\u043C\u0438\u0441\u0441\u0438\u0432\u044B \u2014 \u0444\u043E\u0440\u043C\u0443\u043B\u0438\u0440\u043E\u0432\u0430\u043D\u0438\u0435 \u043E\u0431\u044F\u0437\u0430\u0442\u0435\u043B\u044C\u0441\u0442\u0432 \u043F\u0435\u0440\u0435\u0434 \u0430\u0434\u0440\u0435\u0441\u0430\u0442\u043E\u043C; 4) \u044D\u043A\u0441\u043F\u0440\u0435\u0441\u0441\u0438\u0432\u044B \u2014 \u0434\u0435\u043C\u043E\u043D\u0441\u0442\u0440\u0430\u0446\u0438\u044F \u043F\u0441\u0438\u0445\u043E\u043B\u043E\u0433\u0438\u0447\u0435\u0441\u043A\u043E\u0433\u043E \u0441\u043E\u0441\u0442\u043E\u044F\u043D\u0438\u044F \u0430\u0434\u0440\u0435\u0441\u0430\u0442\u0430; 5) \u0434\u0435\u043A\u043B\u0430\u0440\u0430\u0442\u0438\u0432\u044B \u2014 \u0432\u043B\u0438\u044F\u043D\u0438\u0435 \u043D\u0430 \u0441\u043E\u0446\u0438\u0430\u043B\u044C\u043D\u044B\u0435 \u043E\u0442\u043D\u043E\u0448\u0435\u043D\u0438\u044F \u043B\u044E\u0434\u0435\u0439 [\u0421\u0435\u0440\u043B\u044C 1986:180].</p>',15),n=[r];function s(i,d,p,_,l,u){return t(),o("div",null,n)}var k=e(c,[["render",s]]);export{b as __pageData,k as default};
